import Header from "./Header";

function App() {
  return (
    <div>
      <Header />
      <main>
        <section id="sobre">
          <h2>Sobre</h2>
          <p>Este é o meu portfólio em React!</p>
        </section>
      </main>
    </div>
  );
}

export default App;
